function randInt(min, max) {
    return Math.floor(Math.random() * (max - min + 1) + min);
}

// Hands are face up in this game
EffectAreas.reset();

CardStacks.active[1].shuffle();

const goalDeck = CardStacks.active[0];
const goalLength = randInt(3,5);
const mermaids = randInt(0,2);
const bubbles = goalLength - mermaids;

const goalLeftX = (GAME_INFO.gameWidth / 2) - (goalLength * GAME_INFO.defaultCardWidth / 2);
const goalTopY = (GAME_INFO.gameHeight / 2) - (GAME_INFO.defaultCardHeight / 2);

const goalString = CardStacks.instantiate([], {x: 0, y: 0});

const bubbleStack = goalDeck.separate(bubbles);
goalString.combine(bubbleStack);

contextMenuReverse(goalDeck);

const mermaidStack = goalDeck.separate(mermaids);
if (mermaidStack) {
    goalString.combine(mermaidStack);   
}

CardStacks.destroy(goalDeck.id);


goalString.shuffle();
// Lay cards in a line
for (let i = 0; i < goalLength; i++) {
    const card = goalString.separate(1);
    const xOffset = (i * GAME_INFO.defaultCardWidth);
    card.setPos({x: goalLeftX + xOffset, y: goalTopY});
}
CardStacks.destroy(goalString.id);
